import Vue from 'vue'
Vue.component("PostLayout", () => import("/Users/luisguilherme/Documents/Desenvolvimento/vuepress-netlify-cms/docs/.vuepress/components/PostLayout.vue"))
import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-60a85b3537e08",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/luisguilherme/Documents/Desenvolvimento/vuepress-netlify-cms/docs/README.md").then(comp => {
        Vue.component("v-60a85b3537e08", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-ac27745544fb1",
    path: "/test.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/luisguilherme/Documents/Desenvolvimento/vuepress-netlify-cms/docs/test.md").then(comp => {
        Vue.component("v-ac27745544fb1", comp.default)
        next()
      })
    }
  },
  {
    name: "v-f93feaab4eb39",
    path: "/welcome.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/luisguilherme/Documents/Desenvolvimento/vuepress-netlify-cms/docs/welcome.md").then(comp => {
        Vue.component("v-f93feaab4eb39", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
